import React from "react";
import Router from "./router";
import './test/test';

class AnimalInfo {
  public age = 10;
  public setAge(age: number) {
    this.age = age;
  }
}
interface animal extends AnimalInfo {
  getFood(): string;
}

function App() {
  const panda: animal = {
    age: 20,
    getFood: () => {
      return "bamboo";
    },
    setAge: (age: number) => {},
};

  return (
    <div className="App">
      <Router></Router>
    </div>
  );
}

export default App;
